import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class CsvserviceService {
  items = [];

  getItems() {
    return this.items;
  }

  clearCart() {
    this.items = [];
    return this.items;
  }

  constructor( private http: HttpClient ) { }
}
